 * 
*/

import GlobalStyle from './styles/global'


/**
 * 
 * @Rotas_de_importações
 * 
 */

import App from './routes/index'


ReactDOM.render(
    <Main>
      <App />
    </Main>,
  document.getElementById('root')
);
